var maxCartLen=7;
var myCart = [0,0,0,0,0,0,0];
function generate(doprint) {
	var doc = new jsPDF();
	var imgData = 'data:image/jpeg;base64,';
	doc.addImage(imgData, 'JPEG',0,0,210,297)
	doc.setFontSize(10);
	doc.setFontType("bold");
	var fx=document.forms["myForm"];
	var fx2=document.forms["myForm2"];
	doc.text(String(fx["invn"].value), 42, 62);
	var dte=new Date(fx["invd"].value);
	var dt=dte.getDate();
	var mn=dte.getMonth();
	mn++;
	yy=dte.getFullYear();
	var findate=String(dt+"/"+mn+"/"+yy);
	doc.text(findate, 42, 66.3);
	doc.text(String(fx["trans"].value), 42, 70.6);
	doc.text(String(fx["vehnum"].value), 42, 74.9);
	var optionstxt = {maxWidth : "125"};
	doc.text([String(fx["billto"].value)], 74, 66.3,optionstxt);
	doc.setFontType("normal")
	// ------------------
	var optionstxt = {align : "center",maxWidth : "45"};
	var amtfinal = 0;
	var totquant = 0;
	var sno=0
	for (var i = 0; i < maxCartLen; i++) {
	  if(myCart[i] == 0)
	      continue;
	  doc.text(String(sno+1) + ".", 15, 112+sno*13,optionstxt);
	  doc.text(String(fx2["itemname" + String(i+1)].value), 44, 112+sno*13,optionstxt);
	  doc.text(String(fx2["hsn" + String(i+1)].value), 75.5, 112+sno*13,optionstxt);
	  doc.text(String(fx2["gsm" + String(i+1)].value), 90.7, 112+sno*13,optionstxt);
	  doc.text(String(fx2["size" + String(i+1)].value), 109.2, 112+sno*13,optionstxt);
	  doc.text(String(fx2["quan" + String(i+1)].value), 131.1, 112+sno*13,optionstxt);
	  doc.text(String(fx2["bund" + String(i+1)].value), 147, 112+sno*13,optionstxt);
	  doc.text(String(fx2["Rate" + String(i+1)].value), 164.5, 112+sno*13,optionstxt);
	  var zz = fx2["quan" + String(i+1)].value;
	  var yy = fx2["Rate" + String(i+1)].value;
	  amtfinal = amtfinal + zz*yy;
	  totquant = totquant + zz*1;
	  var amtcur = zz*yy;
	  doc.text(String(amtcur.toFixed(2)), 187, 112+sno*13,optionstxt);
	  sno = sno + 1;
	}
	var xcgst = parseFloat(0);
	var xsgst = parseFloat(0);
	var xigst = parseFloat(0);
    var xcout = parseFloat(fx["carrout"].value);
    var itemcost = amtfinal;
    var xother = parseFloat(fx["otherchg"].value);
    amtfinal = amtfinal + xcout + xother;
	if(fx["igstq"].checked == true)
		xigst = parseFloat(amtfinal*0.12);
	if(fx["cgstq"].checked == true)
		xcgst = parseFloat(amtfinal*0.06);
	if(fx["sgstq"].checked == true)
		xsgst = parseFloat(amtfinal*0.06);
	var totTax = parseFloat(xigst+xcgst+xsgst).toFixed(2);
	var extraCost = xcout+xother;
	var xroundtot=parseFloat(amtfinal+xcgst+xsgst+xigst);
	xroundtot = xroundtot.toFixed(0);
	xroundtot = parseFloat(xroundtot).toFixed(2);
	var xadv = parseFloat(fx["lessadv"].value);
	var gross = parseFloat((xroundtot - xadv)).toFixed(2);
	doc.text(String(parseFloat(totquant).toFixed(3)), 131.1,208,optionstxt);
	doc.text(String(xcout.toFixed(2)), 187, 208,optionstxt);
	doc.text(String(xsgst.toFixed(2)), 187, 224,optionstxt);
	doc.text(String(xcgst.toFixed(2)), 187, 230.5,optionstxt);
	doc.text(String(xigst.toFixed(2)), 187, 236.5,optionstxt);
	doc.text(String(xother.toFixed(2)), 187, 216.5,optionstxt);
	doc.text(String(xroundtot), 187, 245,optionstxt);
	doc.text(String(xadv.toFixed(2)), 187, 253.5,optionstxt);
	doc.setFontType("bold");
	doc.text(String(gross), 187, 263,optionstxt);
	if(doprint == true)
	    doc.save('INVOICE_'+fx["invn"].value+'.pdf');
	else
	{
	    alert(
	    	"\n----------------------------"+
	    	"\nITEM COST: "+itemcost.toFixed(2)+
	    	"\nEXTRA COST: "+extraCost.toFixed(2)+
	    	"\nTAX: "+totTax+
	    	"\nADV PROVIDED: "+xadv.toFixed(2)+
	    	"\n----------------------------"+
	    	"\nFINAL AMOUNT: "+gross+
	    	"\n----------------------------"
	    );
	}
}
function validateForm(doprint) {
	var x = document.forms["myForm"]["invn"].value;
	if (x == "") {
	alert("Enter invoice number");
	return false;
	}
	var x = document.forms["myForm"]["invd"].value;
	if (x == "") {
		alert("Enter invoice date");
		return false;
	}
	var x = document.forms["myForm"]["billto"].value;
	if (x == "") {
		alert("Enter Consignee Details");
		return false;
	}
	var noiteminc = 1;
	for(var i = 0;i < maxCartLen ; i++)
	{
		if(myCart[i] == 0)
	      continue;
	  noiteminc = 0;
		var x = document.forms["myForm2"]["quan" + String(i+1)].value;
		var y = document.forms["myForm2"]["Rate" + String(i+1)].value;
		var z = document.forms["myForm2"]["itemname" + String(i+1)].value;
		if(x == "" || y == "" || z == "") {
		  alert("Enter item "+String(i+1)+" details or REMOVE item "+String(i+1));
		  return false;
		}
	}
	if(noiteminc)
	{
		alert("NO ITEMS ADDED PLEASE ADD ITEM");
		return false;
	}
	if(doprint == true)
	  generate(true);
	return true;
}
function validateFormUtil(){
	if(validateForm(false)  != false)
    generate(false);
}
function addElement(parentId, elementTag,elementId, html) {
	var p = document.getElementById(parentId);
	var newElement = document.createElement(elementTag);
	newElement.innerHTML = html;
	newElement.setAttribute('id', elementId);
	newElement.classList.add("itembox");
	p.appendChild(newElement);
}
function removeItem(ele1,ele2,eid) {
	myCart[eid-1] = 0;
	document.getElementById(ele1).remove();
	document.getElementById(ele2).remove();
	return false;
}
function checkAvailInCart(){
	for(var i = 0;i<maxCartLen;i++)
	{
		if(myCart[i] == 0)
		{
			myCart[i] = 1;
			return i+1;
		}
	}
	return -1;
}
function addItem() {
	var itemid = checkAvailInCart();
	if(itemid == -1)
		{
			alert("CART FULL");
			return;
		}
	var html = '\
    <fieldset class="card2 itemfieldset" style="margin-bottom: 10px;">\
      <legend>ITEM <span style="font-size:25px;font-weight:bold;">['+itemid+']</span> DETAILS</legend>\
      PRODUCT DESC.:<br>\
       <input type="text" name="itemname'+itemid+'" list="itemname'+itemid+'" size="40">\
       <datalist id="itemname'+itemid+'">\
        <option>Snacks Carry Bag with Print</option>\
        <option>YPL Kraft Grossing Carry bag</option>\
        <option>YPL Kraft Paper Carry bag with Handle</option>\
        <option>YPL Kraft Paper Carry bag with Handle & Printing</option>\
        <option>MG Kraft Paper Carry bag with Handle</option>\
        <option>MG Kraft Paper Carry bag with Handle & Printing</option>\
       </datalist><br>\
      GSM: <br><input type="number" step="0.01" name="gsm'+itemid+'"><br>\
      HSN CODE: <br><input type="number" step="1" name="hsn'+itemid+'"><br>\
      SIZE: <br><input type="text" name="size'+itemid+'"><br>\
      QUANTITY (KG/PIECES): <br><input type="number" step="0.01" name="quan'+itemid+'"><br>\
      BUNDLES: <br><input type="number" step="1" name="bund'+itemid+'"><br>\
      RATE (KG/PIECES): <br><input type="number" step="0.01" name="Rate'+itemid+'"><br>\
    </fieldset><br>\
	';
	var btnhtml = '\
	<button style="background-color:#e60000;padding: 10px;" onclick="removeItem(\'itembox'+itemid+'\',\'removebtn'+itemid+'\','+itemid+');"><span style="color: white">REMOVE ITEM #'+itemid+'</span>\
	</button>\
	';
	addElement('items','div','itembox'+itemid,html);
	addElement('itembuttons','div','removebtn'+itemid,btnhtml);
}
